export function OpenPage(x: any,y: any){
    var indice = x
    var target = y

   
    var url = '../Formularios/' + indice + '.tsx'
    
    var doc = document.getElementById(target);

    var xml = new XMLHttpRequest()
  
    var doc = document.getElementById(target);

    
    if(doc != null)
    {
      doc.innerHTML = xml.responseText
    }
        

    //xml.onreadystatechange = doc.innerHTML;

    xml.open('GET', url, true)

    xml.send()
}
